import { ErrorMessage, Field, Form, Formik } from 'formik';
import React, { useEffect, useState } from 'react';
import { Link } from "react-router-dom";
import { getUser } from '../../Utils/Common';
import { useLocation } from 'react-router-dom';
import '../../Utils/Constants';
import ModalGen from '../../Utils/Modals/ModalGeneric';
import GenericApi from '../../Api/Services/GenericApi';
import Spinner from '../../Utils/Spinner';
import { useParams } from "react-router";

function EntidadMigracionLista() {

    const [getModalState, setModalState] = useState({ title: "", message: "", show: false });
    const [getListaEntidades, setListaEntidades] = useState({ data: [], links: [], meta: [] });

    let { radicado, vigencia} = useParams();


    useEffect(() => {
        async function fetchData() {
            window.showSpinner(true);
            listaAntecedentes();
            
           
        }
        fetchData();
    }, []);


    const listaAntecedentes= () => {
        try {

            //buscamos el parametro
            GenericApi.getGeneric("migracion-lista-entidades/"+radicado+"/"+vigencia).then(
                datos => {

                    if (!datos.error) {
                        setListaEntidades(datos);

                    } else {
                        //setModalState({ title: "MigraciÃ³n Datos del interesado", message: datos.error.toString(), show: true, redirect: '/AntecedentesForm', alert: global.Constants.TIPO_ALERTA.ERROR });
                    }
                    window.showSpinner(false);
                }
            )
        } catch (error) {
            // console.log(error);
        }
    }


    const lista = () => {

        if (getListaEntidades.data != null && typeof (getListaEntidades.data) != 'undefined') {
            return (

                getListaEntidades.data.map((item, i) => {
                    return (
                        <tr>
                            <td>{i=i+1}</td>
                            <td>{item.attributes.version}</td>
                            <td>{item.attributes.entidad}</td>
                            <td>{item.attributes.sector}</td>
                            <td>{item.attributes.nombreInvestigado}</td>
                            <td>{item.attributes.cargoInvestigado}</td>
                            <td><Link className="text-dark" to={`/CargarMigracionEntidad/${radicado}/${vigencia}/${item.attributes.id}`}><small>Completar informaciÃ³n</small></Link></td>
                        </tr>
                    )
                })
            )
        }
    }


    return (
        <>
            {<Spinner />}   
            {<ModalGen data={getModalState} />}
          
            <div className="w2d_block">
                <nav aria-label="breadcrumb">
                    <ol className="breadcrumb breadcrumb-alt push">
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`}><small>Inicio proceso de migraciÃ³n</small></Link></li>
                        <li class="breadcrumb-item"> <small>Lista de interesados</small></li>
                    </ol>
                </nav>
            </div>

            <div className="block block-themed">
                <div className="block-header">
                    <h3 className="block-title">Proceso disciplinario :: {radicado} - {vigencia}</h3>
                </div>

                <div className="block-content">
                    
                    <div className="col-md-12">

                        <table class="table">
                            <thead>
                                <tr>
                                    <th scope="col">#</th>
                                    <th scope="col">VersiÃ³n</th>
                                    <th scope="col">Entidad</th>
                                    <th scope="col">Sector</th>
                                    <th scope="col">Nombre investigado</th>
                                    <th scope="col">Cargo investigado</th>
                                    <th scope="col">Acciones</th>
                                </tr>
                            </thead>
                            <tbody>
                                   {lista()}                 
                            </tbody>
                        </table>
                        
                    </div>
                </div>
                
            </div>

                   
        </>
    );
}


export default EntidadMigracionLista;
